class Solution {
public:
    bool divideArray(vector<int>& nums) {
        int pair_num = nums.size();
        vector<int> num_count(501, 0);

        for (int i=0; i<nums.size(); i++) {
            num_count[nums[i]]++;
        }
        for (int j=0; j<num_count.size(); j++) {
            if(num_count[j] > 0 && num_count[j] % 2 != 0) {
                return false;
            }
        }
        return true;
    }
};
